import React from 'react';
import Cards from './Cards';

const CardsList = ({ people }) => {
	return(
		<div>
			{
				people.map((person, i) => {
					{ people && <Cards person = { (people[i]) }/> }					
				})		
			}
		</div>
	)
}

export default CardsList;
